column8:
純正リアバンパーを取り外した際、<br>
みっともない状態になってしまう、<br>
ビス穴隠しやオーバーフェンダーエンドの<br>
左右セット4分割1台分です。<br>
ランクル70バン及びランクル70プラドの<br>
オーバーフェンダー付き4ドア車全車に装着可能なFRP製です。<br>
ブラックゲルコート仕上げで、塗装を前提とした仕上げです。<br>
写真はGRJ76への取り付け例でつや消しブラックに塗装済みです。<br>
4X4エンジニアリング製。 <br>
受注後の取り寄せ商品です。<br>
納期がかかる場合がありますので、<br>
お急ぎの場合は先に納期をご確認ください。<br>
送料区分 ： 120<!-- ここから リア受 -->
